import Card from 'react-bootstrap/Card';
import './App.css';

function App() {
  return (
    <div className="app-container">
      <Card style={{ width: '18rem' }}>
        <Card.Body>
          <Card.Title>Register Account</Card.Title>
          <Card.Subtitle className="mb-2 text-muted">Create a new Account</Card.Subtitle>
        </Card.Body>
      </Card>
    </div>
  );
}

export default App;
